# BIGG BRAIN PLOT

# First we build a matrix such as :
#
#         Algo1     Algo2     Algo3 ...
# k = 1   clusters  clusters  clusters
# k = 2   clusters  clusters  clusters
# k = 3   clusters  clusters  clusters
# ...
#
#


algos <- list(
  c("euclidian","single"),
  c("euclidian","average"),
  c("euclidian","complete"),
  c("manhattan","single"),
  c("manhattan","average"),
  c("manhattan","complete"),
  c("canberra","single"),
  c("canberra","average"),
  c("canberra","complete")
)



j = 1
k = 10
l = length(algos)

# it's just gonna be a long-boi list
aval <- list()
l=1
for(step in j:k){
  for(algo in algos){
    aval[[l]] <-list(visible = FALSE,
                        x = reduced_M_scaled$v1,
                        y = reduced_M_scaled$v2,
                        lab = rownames(reduced_M_scaled),
                        col = hcut(M_scaled, step, hc_method = algo[2], hc_metric= algo[1])$cluster)
    l=l+1
    }
}
aval[k-1][[1]]$visible = TRUE

# create steps and plot all traces
steps <- list()
fig <- plot_ly()
l=1
for (i in j:k) {
  for(algo in algos){
    fig <- add_markers(fig,
                       name = paste(i,algo[1], algo[2], "clusters"),
                       x=aval[l][[1]]$x,  y=aval[l][[1]]$y, 
                       visible = aval[l][[1]]$visible,
                       hoverinfo = "text",
                       text  = aval[l][[1]]$lab,
                       marker = list(color = aval[l][[1]]$col),
                       showlegend = F) 
    
    step <- list(args = list('visible', rep(FALSE, length(aval))),
                 method = 'restyle', label = paste(i,algo[1], algo[2], "clusters"))
    step$args[[2]][l] = TRUE  
    steps[[l]] = step 
    l=l+1
  }
}  






# add slider control to plot
fig <- fig %>%
  layout(sliders = list(
    list(active = k-1, 
         currentvalue = list(prefix = "Number of clust: "), 
         steps = steps)
  )
  )




